(()=>{"use strict";window.showContent=(e,t)=>{if(!t||!e)return;if(e.classList.contains("active"))return;let l=document.querySelectorAll("#orders-audit-collapse .orders-collapse-btn");if(l.length>0){if(0===document.querySelectorAll("."+t).length)return;l.forEach(t=>{e===t?(e.classList.add("active"),document.querySelector('[data-orders-audit-collapse="title"]').innerText="«"+e.innerText+"»"):t.classList.remove("active")}),document.querySelectorAll(".orders-collapse-content").forEach(e=>{e.style.display=e.classList.contains(t)?"":"none"})}}})();